import React, { useState } from 'react';
import axios from 'axios';
import { useHistory } from 'react-router-dom';  // To handle page navigation

const AddQuestion = () => {
    const history = useHistory();
    
    const [question, setQuestion] = useState('');
    const [options, setOptions] = useState(['', '', '']);
    const [correctOption, setCorrectOption] = useState('');
    const [mark, setMark] = useState('');
    const [negativeMark, setNegativeMark] = useState('');
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const [successMessage, setSuccessMessage] = useState('');

    const handleOptionChange = (index, value) => {
        const newOptions = [...options];
        newOptions[index] = value;
        setOptions(newOptions);
    };

    const addOption = () => {
        setOptions([...options, '']);
    };

    const handleSubmit = async () => {
        setLoading(true);

        try {
            const response = await axios.post('http://localhost:8000/staff/addquestion/', {
                question,
                options,
                correctOption,
                mark,
                negativeMark
            });

            if (response.status === 200) {
                setSuccessMessage('Question added successfully!');
                setError(null);
            }
        } catch (err) {
            console.error('Error submitting question:', err);
            setError('Failed to add question. Please try again.');
            setSuccessMessage('');
        } finally {
            setLoading(false);
        }
    };

    const handleBack = () => {
        history.push('/');  // Navigate back to home or the previous page
    };

    return (
        <div className="add-question-container">
            <h1>Add Question</h1>

            <div className="form-group">
                <label>Question*</label>
                <textarea
                    value={question}
                    onChange={(e) => setQuestion(e.target.value)}
                    placeholder="Enter your question here"
                />
            </div>

            <div className="form-group">
                <label>Options*</label>
                {options.map((option, index) => (
                    <input
                        key={index}
                        type="text"
                        value={option}
                        onChange={(e) => handleOptionChange(index, e.target.value)}
                        placeholder={`Option ${index + 1}`}
                    />
                ))}
                <button onClick={addOption} className="add-option-btn">Add Option</button>
            </div>

            <div className="form-group">
                <label>Correct Option*</label>
                <input
                    type="text"
                    value={correctOption}
                    onChange={(e) => setCorrectOption(e.target.value)}
                    placeholder="Enter correct option"
                />
            </div>

            <div className="form-group">
                <label>Mark*</label>
                <input
                    type="number"
                    value={mark}
                    onChange={(e) => setMark(e.target.value)}
                    placeholder="Enter mark"
                />
            </div>

            <div className="form-group">
                <label>Negative Mark*</label>
                <input
                    type="number"
                    value={negativeMark}
                    onChange={(e) => setNegativeMark(e.target.value)}
                    placeholder="Enter negative mark"
                />
            </div>

            {loading && <div className="loading">Submitting...</div>}
            {successMessage && <div className="success-message">{successMessage}</div>}
            {error && <div className="error">{error}</div>}

            <div className="form-buttons">
                <button onClick={handleSubmit} className="submit-btn">Submit</button>
                <button onClick={handleBack} className="back-btn">Back</button>
            </div>
        </div>
    );
};

export default AddQuestion;
